import {
  READ_REQUESTS,
  GET_CLOTHS
} from '../actions';


export default (state = {}, action) => {
  switch (action.type) {
    case READ_REQUESTS:
      console.log(action)
      return state


    case GET_CLOTHS:
      return action.response.data

    default:
      return state
  }
}
